pragma solidity >=0.4.25 <0.9.0;

contract FirebaseSystem{
    mapping (uint => mapping (string => address[])) addresses;
    uint counter = 0;

    function createAddress(uint _paymentStatus, string memory _date, address _addr) public{
        addresses[_paymentStatus][_date].push(_addr);
        counter++;
    }


    function getAddress(uint _paymentStatus, string calldata _date) external view returns(address[] memory){
        address[] memory tempList = new address[](counter);
        for (uint i = 0; i < counter; i++){
        tempList[i] = addresses[_paymentStatus][_date][i];
        }
        return tempList;
    }


    constructor() public{
        createAddress(1, "0712", 0x70Eda919278179BA6E546F7EDeaf2383cE41cC4e);
        createAddress(1, "0712", 0xF093C5A67aa483923Ff5AA96D16fCa851F16392D);

    }
}
